df = pd.DataFrame(data)
df["ConsentDate"] = pd.to_datetime(df["ConsentDate"], errors="coerce")
df["EnrollmentDate"] = pd.to_datetime(df["EnrollmentDate"], errors="coerce")

@router.get("/filters")
def get_filters():
    return {
        "trials": sorted(df["TrialID"].unique().tolist()),
        "sites": sorted(df["Site"].unique().tolist()),
        "coordinators": sorted(df["Coordinator"].unique().tolist()),
        "consent_methods": sorted(df["ConsentMethod"].unique().tolist())
    }

@router.post("/run-report", response_model=ReportResponse)
async def run_report(data: Annotated[ReportInput, Form()]):
    filtered = df[df["TrialID"] == data.trial]
    if data.site and data.site != "All":
        filtered = filtered[filtered["Site"] == data.site]
    if data.coordinator and data.coordinator != "All":
        filtered = filtered[filtered["Coordinator"] == data.coordinator]
    if data.method and data.method != "All":
        filtered = filtered[filtered["ConsentMethod"] == data.method]

    filtered["MissingConsent"] = filtered["ConsentDate"].isna()
    filtered["LateConsent"] = (filtered["EnrollmentDate"] - filtered["ConsentDate"]).dt.days > 3
    filtered["OutdatedProtocol"] = filtered["ConsentVersion"] != filtered["ProtocolVersionAtConsent"]
    filtered["Flagged"] = (
        filtered["MissingConsent"] |
        ~filtered["FormsComplete"] |
        filtered["Withdrawn"] |
        filtered["OutdatedProtocol"]
    )

    if data.show_flags_only:
        filtered = filtered[filtered["Flagged"]]

    avg_time = (filtered["EnrollmentDate"] - filtered["ConsentDate"]).dt.days.mean()
    late_count = int(filtered["LateConsent"].sum())
    form_error = round((~filtered["FormsComplete"]).mean() * 100, 2)
    withdrawn = int(filtered["Withdrawn"].sum())

    kpis = KPIResult(
        average_consent_time=f"{avg_time:.1f} days" if pd.notna(avg_time) else "N/A",
        late_consents=late_count,
        form_error_rate=f"{form_error}%",
        withdrawn=withdrawn
    )

    def fig_to_base64(fig):
        try:
            img_bytes = fig.to_image(format="png")
            return base64.b64encode(img_bytes).decode()
        except Exception as e:
            return f"Error generating chart: {str(e)}"

    charts = {
        "consent_status_by_site": fig_to_base64(px.histogram(filtered, x="Site", color="ConsentStatus", barmode="group")),
        "consent_method_distribution": fig_to_base64(px.pie(filtered, names="ConsentMethod")),
        "cumulative_enrollments": fig_to_base64(px.line(
            filtered.dropna(subset=["EnrollmentDate"]).sort_values("EnrollmentDate"),
            x="EnrollmentDate", y=list(range(1, len(filtered.dropna(subset=["EnrollmentDate"]))+1)))
        )
    }

    return ReportResponse(
        kpis=kpis,
        records=filtered.fillna("").to_dict(orient="records"),
        charts_base64=charts
    )
